import React from 'react';
import './Footer.css';

const FooterInfo = () => (
    <div className="footer-left">
        <p className="footer-logo">COOLZY</p>
        <div className="footer-text">
            <p className="royal-attue">COOLZY предлагает технику и аксессуары от мировых брендов.</p>
            <p className="quote">“Каждая деталь создана для тех, кто ценит стиль, качество и роскошь”</p>
        </div>
    </div>
);

const FooterLinksSection = ({ title, links }) => (
    <div className="footer-links-section">
        <div className="footer-section-title">{title}</div>
        {links.map((link, index) => (
            <div key={index} className="footer-link">
                <a href={link.href} className="dynamic-link">{link.text}</a>
            </div>
        ))}
    </div>
);

const FooterContacts = () => (
    <div className="footer-contacts">
        <div className="footer-section-title">КОНТАКТЫ</div>
        <div className="footer-link">г. Минск<br />ул. Колесникова 3</div>
        <div className="footer-link">+375 (44) 544-21-21</div>
        <div className="footer-link">COOLZY@gmail.com</div>
    </div>
);

const FooterLogos = () => (
    <div className="footer-logos">
        <img className="payment-logo" alt="Мир" src="./images/mir-logo.png" />
        <img className="payment-logo" alt="MasterCard" src="./images/master_card.png" />
        <img className="payment-logo" alt="Visa" src="./images/Visa.png" />
    </div>
);

const Footer = () => (
    <div className="footer-background">
        <div className="footer">
            <div className="footer-info">
                <FooterInfo />
                <div className="footer-right">
                    <FooterLinksSection
                        title="О КОМПАНИИ"
                        links={[
                            { text: 'О нас', href: './../../code/about_us/about_us.html' },
                            { text: 'Политика персональных данных', href: './../../code/personal_data/personal_data.html' }
                        ]}
                    />
                    <FooterLinksSection
                        title="ПОКУПАТЕЛЯМ"
                        links={[
                            { text: 'Возврат/Обмен', href: './../../code/return_obmen/return_obmen.html' },
                            { text: 'Доставка и оплата', href: './../../code/delivery_pay_answ/delivery_pay_answ.html' },
                            { text: 'Бонусная программа', href: './../../code/bonus_program/bonus_program.html' },
                            { text: 'Вопросы/ответы', href: './../../code/ques_answ/ques_answ.html' }
                        ]}
                    />
                    <FooterContacts />
                </div>
            </div>
            <FooterLogos />
            <div className="footer-copyring">(c) 2024 - Наш лучший магазин</div>
        </div>
    </div>
);

export default Footer;
